const Content = () => {
	const handleNameChange = () => {
		const names = ["Bob", "Julie", "Thomas", "Mathias"];
		const int = Math.floor(Math.random() * 3);
		return names[int];
	};

	const handleClick = (name) => {
		console.log(`${name} was clicked`);
	};
	const handleClickev = (name) => {
		console.log(`${name} was clicked`);
	};

	return (
		<div>
			<main>
				<p>Hello {handleNameChange}</p>
				<button onClick={() => handleClick("ismail")}>Click it</button>
			</main>
		</div>
	);
};

export default Content;
